##AVERAGE WEIGHT in POUNDS
SELECT
	lerbay_zoo_lab.animals.id,lerbay_zoo_lab.animals.individual_name, 	
	ROUND(AVG(lerbay_zoo_lab.animal_stats.weight)/453.592,3)  as avg_pounds
FROM
	lerbay_zoo_lab.animals
INNER JOIN
	lerbay_zoo_lab.animal_stats
ON 
	lerbay_zoo_lab.animals.id = lerbay_zoo_lab.animal_stats.animal_id
GROUP BY
	lerbay_zoo_lab.animal_stats.animal_id
ORDER BY 
	avg_pounds DESC;
    

### AVG WEIGHT IN POUNDS WITH REMANDER AS OUNCES
SELECT
	lerbay_zoo_lab.animals.id,lerbay_zoo_lab.animals.individual_name, 	
	ROUND(AVG(lerbay_zoo_lab.animal_stats.weight)/453.592,0)  as avg_pounds, 
    ROUND(AVG(lerbay_zoo_lab.animal_stats.weight)/453.592,3)% FLOOR(AVG(lerbay_zoo_lab.animal_stats.weight)/453.592)*16 as and_ounces
FROM
	lerbay_zoo_lab.animals
INNER JOIN
	lerbay_zoo_lab.animal_stats
ON 
	lerbay_zoo_lab.animals.id = lerbay_zoo_lab.animal_stats.animal_id
GROUP BY
	lerbay_zoo_lab.animal_stats.animal_id
ORDER BY 
	avg_pounds DESC;

	
