CREATE  VIEW spec_weight AS
SELECT
	id, individual_name, cal_date, weight
FROM 
    lerbay_zoo_lab.animals
INNER JOIN
	lerbay_zoo_lab.animal_stats
ON 
	lerbay_zoo_lab.animals.id = lerbay_zoo_lab.animal_stats.animal_id
WHERE
	(start_date <= DATE('2014-12-01')  AND
    cal_date >= DATE('2014-12-01')) AND
    cal_date <= DATE('2015-11-23') AND
    end_date IS NULL
ORDER BY 
	id ASC, cal_date ASC; 
    

SELECT *
