	spec_weight;
    
CREATE TEMPORARY TABLE min_date_weight AS
SELECT
	sp1.id, sp2.start_date as start_date, sp1.weight as start_weight
FROM
	spec_weight as sp1
INNER JOIN 
(
	SELECT 
		id, min(cal_date) as start_date
    FROM
		spec_weight 
	GROUP BY
		id
) as sp2
ON
	sp1.id = sp2.id AND
    sp1.cal_date = sp2.start_date
GROUP BY
id;
    


CREATE TEMPORARY TABLE max_date_weight AS
SELECT
	sp1.id, sp2.end_date, sp1.weight as end_weight
FROM
	spec_weight as sp1
INNER JOIN 
(
	SELECT 
		id, max(cal_date) as end_date
    FROM
		spec_weight 
	GROUP BY
		id
) as sp2
ON
	sp1.id = sp2.id AND
    sp1.cal_date = sp2.end_date
GROUP BY
id;

    
DROP TABLE max_date_weight;  
DROP TABLE min_date_weight;      

SELECT *
FROM 
	min_date_weight;
    

SELECT
	min_date_weight.id, start_date, start_weight, end_date, end_weight, (end_weight -start_weight)/start_weight as perc
FROM
	min_date_weight
JOIN
	max_date_weight
ON
	min_date_weight.id = max_date_weight.id
GROUP BY
	id
ORDER BY
	perc DESC;
    
