CREATE TEMPORARY TABLE Barky_Cal_w AS
SELECT
	bw1.id, bw1.cal_date, bw1.weight, datediff( bw1.cal_date, min_date) as nDays
FROM 
	Barky_weights as bw1
INNER JOIN (
	SELECT 
		id,  min(cal_date) as min_date
	FROM
		Barky_weights
	) AS bw2
ON
	bw1.id = bw2.id 
HAVING
	nDays <=365
ORDER BY
	cal_date ASC;

