CREATE TABLE weeks_per_anm AS
SELECT
	aw1.id, aw1.individual_name,  aw1.cal_date, aw1.weight, datediff( max_date, aw1.cal_date) / 7 as Weeks_until_end
FROM 
	animal_w as aw1
INNER JOIN (
	SELECT 
		id,  max(cal_date) as max_date
	FROM
		animal_w 
	GROUP BY
		id
	) AS aw2
ON
	aw1.id = aw2.id 
WHERE
	aw1.end_date IS NOT NULL
HAVING
	Weeks_until_end <= 8
order by
	id ASC, cal_date ASC, Weeks_until_end ASC;

